import PropTypes from 'prop-types';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const TabPane = props => {
    const { key, icon, children, className, ...tabPaneProps } = props;

    return (
        <div
            key={key}
            className={`flex justify-between cursor-pointer py-3 mb-2 text-color-red-500  ${className}`}
            {...tabPaneProps}
        >
            <div className='flex items-center'>
                <FontAwesomeIcon icon={icon} className='fa-2x mr-2' />
                <span className='text-lg font-medium'>{children}</span>
            </div>
            <FontAwesomeIcon icon='chevron-right' className='fa-1x self-center mr-10' />
        </div>
    );
};

TabPane.propTypes = {
    className: PropTypes.string,
    key: PropTypes.string,
};

export default TabPane;
